import React from 'react';
import classes from './Btn_links.module.css';
import {brands} from  '../../../OffersData';


const Btn_links = () => {

  const Links = brands ((item) =>
	<div className={classes.links} key={item.id}>

   <button href={item.book}>Book</button>
	

	</div>
	)
   
	return (
		<div className={classes.wrapper_brand} >
		{Links}
		</div>
 
	)

}


export default Btn_links;
